import './App.css';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import {useState} from 'react';

function App() {
  return (
    <div className="App">
     <Router>
      <Routes>
        <Route path="/" />
      </Routes>
     </Router>
    </div>
  );
}

export default App;
